import {FuseLoadable} from '@fuse';

export const EventsConfig = {
    settings: {
        layout: {}
    },
    routes: [
        {
            path     : '/smartevents/event',
            component: FuseLoadable({
                loader: () => import('./EventsMainPage')
            })
        },
